INSERT INTO `diary` VALUES (18, '第一篇日记', '✨ 确幸时刻', '今天早起的时候心情其实有点灰蒙蒙的，看着窗外的雾气，突然陷入了一种莫名的精神内耗，总觉得手头的事情多得理不清楚，甚至产生了一种想要逃避的挫败感。😶‍🌫️\n\n下午去楼下的咖啡店坐了一会儿，点了一杯热气腾腾的拿铁。就在那一瞬间，阳光突然穿过云层洒在桌面上，耳机里刚好随机播放到了那首最喜欢的纯音乐。突然觉得，那些焦虑的事情好像也没那么重要了。\n\n那一刻真的有被治愈到，那种久违的“确幸时刻”让整个人都松弛了下来。回来的路上顺便买了一束花，现在满屋子都是淡淡的清香。虽然生活还是有很多不确定性，但此刻，我只想好好享受这份回甘后的释然。🍵✨', '2025-12-27 21:21:22', NULL, 5);
INSERT INTO `diary` VALUES (20, '第三篇', '🍵 回甘释然', 'wwww~~~~~~~~~~~~asadsasd', '2025-12-27 21:31:24', NULL, 4);
INSERT INTO `diary` VALUES (22, '新的一天2', '✨ 确幸时刻', '今天项目的进度终于推到了全栈联调阶段，看着手机屏幕上动态滑动的“情绪底色条”，那一瞬间真的很有成就感。🔋\n\n不过，下午在写代码的时候，被一个复杂的布局嵌套卡了很久，当时莫名觉得有点心烦气躁，甚至开始怀疑自己的能力。那种迷惘寻索的感觉，像是掉进了一个死循环。🧭\n\n傍晚去外面散了会儿步，雨后的空气凉凉的，反而让我清醒了许多。回到电脑前，换了个思路，问题竟然迎刃而解。这种从纠结到释然的过程，虽然有点累，但真的很充实。\n\n其实生活就像写代码，总会有几个解决不掉的 Bug，但只要停下来喘口气，总能找到最优解。🍵', '2025-12-27 22:04:05', NULL, 4);
INSERT INTO `diary` VALUES (23, '茫然的一天', '🧊 情感隔离', '既然你的 MomentFlow 后端使用的是 Java 17 + Spring Boot，且前端已经实现了那种丝滑的“情绪底色条”，我为你准备了一篇充满“转折感”的日记。\n\n这篇日记涵盖了多种情绪，非常适合用来测试你的 AI 情绪分析（小流） 是否能识别复杂的情感流向，以及前端的比例图表是否能精准捕捉这些标签。\n\n📅 2025年12月27日 · 晴转微雨\n标题：在代码与情绪的流动中，寻找平衡\n\n今天真是一场“全栈拉锯战”。早上起来动力满满，一口气把后端 Redis 的验证码逻辑调通了，看着邮件精准地落入收件箱，那一刻觉得自己简直是代码界的指挥家。🔋 （充满动力）\n\n但下午在处理 HarmonyOS 前端的那个 onVisibleAreaChange 监听时，页面刷新死活不对。那一瞬间，之前的成就感荡然无存，坐在电脑前盯着屏幕，满脑子都是逻辑盲点，整个人陷入了一种极深的自我怀疑。🧭 （迷惘寻索）\n\n直到刚才，我合上电脑，去楼下便利店买了一罐热咖啡。雨后的空气带着泥土的味道，风凉凉的，吹在脸上很清醒。我突然意识到，茫然其实是代码给我的反馈，它在提醒我该停下来呼吸了。\n\n重新回到座位，我不再纠结那个 Bug，而是把这一天的起伏记在 MomentFlow 里。当我看到这三个色块在屏幕上跳动，那种纠结感竟然慢慢化开了。🍵 （回甘释然）\n\n也许，生活和代码一样，不需要时刻保持逻辑完美。允许自己偶尔失控，本身就是一种掌控。', '2025-12-27 22:20:02', NULL, 4);
INSERT INTO `diary` VALUES (24, 'ai', '🥀 挫败感', 'hai', '2025-12-27 22:21:36', NULL, 4);
INSERT INTO `diary` VALUES (25, '开心的一天', '✨ 确幸时刻', '今天真是近期心情最“顶”的一天！🔋 （充满动力）\n\n早上一睁眼，阳光就直接铺在了床单上，那种久违的明亮感让人心情瞬间起飞。没有设闹钟，自然醒的感觉真的太奢侈了。\n\n今天的工作效率也高得离谱。之前卡了很久的那个后端接口，今天居然在喝咖啡的功夫就写顺了。看着控制台一行行整齐跳出的 200 OK，那种掌控感比打赢一场游戏还要爽！✨ （确幸时刻）\n\n中午约了朋友去吃那家种草很久的居酒屋，虽然排了很久的队，但第一口厚切三文鱼入口的时候，觉得一切等待都值了。我们聊了很多关于未来的计划，这种有人懂、有共鸣的感觉，让我觉得在这个城市里一点也不孤单。🤝 （归属感）\n\n现在的我，正坐在窗边，吹着微凉的晚风，看远处的灯火一点点亮起。没有压力，没有焦虑，只有一种由内而外的轻快。\n\n如果生活能一直保持这个 Flow，那真的太美好了。', '2025-12-27 22:26:24', NULL, 4);

